// JobsPage.jsx
import React, { useState } from 'react';

const JobsPage = () => {
  const [jobs, setJobs] = useState([
    {
      id: 1,
      ship: 'Unknown Ship',
      component: 'engine',
      type: 'inspection',
      priority: 'high',
      status: 'in progress',
      startDate: 'May 12, 2025 01:38',
      assignedTo: 'Unassigned'
    }
  ]);

  const [filterShip, setFilterShip] = useState('All Ships');
  const [filterStatus, setFilterStatus] = useState('All Statuses');
  const [filterPriority, setFilterPriority] = useState('All Priorities');

  const updateJobStatus = (jobId, newStatus) => {
    setJobs(jobs.map(job => 
      job.id === jobId ? { ...job, status: newStatus } : job
    ));
  };

  // Now using filteredJobs in the table instead of jobs
  const filteredJobs = jobs.filter(job => {
    return (
      (filterShip === 'All Ships' || job.ship === filterShip) &&
      (filterStatus === 'All Statuses' || job.status === filterStatus) &&
      (filterPriority === 'All Priorities' || job.priority === filterPriority)
    );
  });

  const handleComplete = (jobId) => {
    updateJobStatus(jobId, 'completed');
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1>ShipMaster</h1>
      
      <div style={{ display: 'flex', gap: '20px', marginBottom: '20px' }}>
        <div style={{ display: 'flex', flexDirection: 'column', gap: '5px' }}>
          <label>Filter by Ship:</label>
          <select 
            value={filterShip} 
            onChange={(e) => setFilterShip(e.target.value)}
            style={{ padding: '5px', borderRadius: '4px', border: '1px solid #ddd' }}
          >
            <option value="All Ships">All Ships</option>
            <option value="Unknown Ship">Unknown Ship</option>
          </select>
        </div>

        <div style={{ display: 'flex', flexDirection: 'column', gap: '5px' }}>
          <label>Filter by Status:</label>
          <select 
            value={filterStatus} 
            onChange={(e) => setFilterStatus(e.target.value)}
            style={{ padding: '5px', borderRadius: '4px', border: '1px solid #ddd' }}
          >
            <option value="All Statuses">All Statuses</option>
            <option value="in progress">In Progress</option>
            <option value="completed">Completed</option>
          </select>
        </div>

        <div style={{ display: 'flex', flexDirection: 'column', gap: '5px' }}>
          <label>Filter by Priority:</label>
          <select 
            value={filterPriority} 
            onChange={(e) => setFilterPriority(e.target.value)}
            style={{ padding: '5px', borderRadius: '4px', border: '1px solid #ddd' }}
          >
            <option value="All Priorities">All Priorities</option>
            <option value="high">High</option>
            <option value="medium">Medium</option>
            <option value="low">Low</option>
          </select>
        </div>
      </div>

      <table style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr>
            <th>Job ID</th>
            <th>Ship</th>
            <th>Component</th>
            <th>Type</th>
            <th>Priority</th>
            <th>Status</th>
            <th>Start Date</th>
            <th>Assigned To</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {filteredJobs.map(job => (
            <tr key={job.id}>
              <td>#{job.id}</td>
              <td>{job.ship}</td>
              <td>{job.component}</td>
              <td>{job.type}</td>
              <td style={{ 
                color: job.priority === 'high' ? '#e74c3c' : 
                      job.priority === 'medium' ? '#f39c12' : '#2ecc71',
                fontWeight: 'bold'
              }}>
                {job.priority}
              </td>
              <td>{job.status}</td>
              <td>{job.startDate}</td>
              <td>{job.assignedTo}</td>
              <td>
                <button 
                  style={{ 
                    padding: '5px 10px',
                    marginRight: '5px',
                    border: 'none',
                    borderRadius: '4px',
                    cursor: 'pointer',
                    backgroundColor: '#2ecc71',
                    color: 'white'
                  }}
                  onClick={() => handleComplete(job.id)}
                >
                  Complete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default JobsPage;
